def how_many_times(string: str, substring: str) -> int:
    if substring == "":
        return 0
    n = len(string)
    m = len(substring)
    if m > n:
        return 0

    lps = [0] * m
    length = 0
    i = 1
    while i < m:
        if substring[i] == substring[length]:
            length += 1
            lps[i] = length
            i += 1
        else:
            if length != 0:
                length = lps[length-1]
            else:
                lps[i] = 0
                i += 1

    count = 0
    i = 0
    j = 0
    while i < n:
        if j < m and string[i] == substring[j]:
            i += 1
            j += 1
        if j == m:
            count += 1
            j = lps[j-1]
        elif i < n and string[i] != substring[j]:
            if j != 0:
                j = lps[j-1]
            else:
                i += 1
    return count

