def rescale_to_unit(numbers: List[float]) -> List[float]:
    min_val = min(numbers)
    max_val = max(numbers)
    denom = max_val - min_val
    if denom == 0:
        return [0.0] * len(numbers)
    return [(x - min_val) / denom for x in numbers]

