def find_zero(xs: list):
    if len(xs) == 2:
        return -xs[0] / xs[1]

    const = xs[0]
    leading = xs[-1]

    def get_divisors(num):
        if num == 0:
            return []
        divs = set()
        for i in range(1, abs(num) + 1):
            if num % i == 0:
                divs.add(i)
                divs.add(-i)
        return divs

    numerators = get_divisors(const)
    denominators = get_divisors(leading)

    candidates = set()
    for num in numerators:
        for den in denominators:
            if den != 0:
                candidates.add(num / den)

    for candidate in candidates:
        if abs(poly(xs, candidate)) < 1e-7:
            return candidate

    a, b = -100.0, 100.0
    fa = poly(xs, a)
    fb = poly(xs, b)
    if fa * fb > 0:
        a, b = -1.0, 1.0
        fa, fb = poly(xs, a), poly(xs, b)
    tolerance = 1e-7
    max_iter = 100
    for _ in range(max_iter):
        c = (a + b) / 2.0
        fc = poly(xs, c)
        if abs(fc) < tolerance:
            return c
        if fa * fc < 0:
            b = c
            fb = fc
        else:
            a = c
            fa = fc
    return (a + b) / 2.0

