def triangle_area(a, b, c):
    total = a + b + c
    max_val = max(a, b, c)
    if total - max_val <= max_val:
        return -1
    s = total / 2.0
    area = (s * (s - a) * (s - b) * (s - c)) ** 0.5
    return round(area, 2)

def triangle_area(a, b, c):
    x = min(a, b, c)
    z = max(a, b, c)
    y = a + b + c - x - z
    if x + y <= z:
        return -1
    s = (x + y + z) / 2.0
    area = (s * (s - x) * (s - y) * (s - z)) ** 0.5
    return round(area, 2)

